import {
    Menu,
    CalendarDays,
    LayoutList,
    Users
  } from "lucide-react";

export default function NavBar() {
    return (
        <div className="bg-gray-200 h-screen w-[50px]">
            <div className="flex justify-center">
                <button><Menu /></button>
            </div>
            <nav className="bg-slate-500 h-screen flex items-center justify-center space-y-5">
                <ul className="space-y-10 ">
                    <li> <CalendarDays /> </li>
                    <li> <LayoutList /></li>
                    <li> <Users /> </li>

                </ul>
            </nav>
        </div>
    )
}
